import type { Meta, StoryObj } from '@storybook/angular';
import { CardMetricsComponent } from '@indziaki/ngx-xchange-ui';
interface ExtendedCardMetricsComponent extends CardMetricsComponent{
  symbol: string | null;
}
const meta: Meta<CardMetricsComponent> = {
  title: 'xChange/MetricsComponent',
  component: CardMetricsComponent,
  tags: ['autodocs'],
  render: (args: CardMetricsComponent) => ({
    props: {
      backgroundColor: null,
      ...args,
    },
  }),
  argTypes: {

  },
};

export default meta;
type Story = StoryObj<ExtendedCardMetricsComponent>;

export const Primary: Story = {
  args: {
    value: 5,
    description: 'Just',
    symbol: '&#8364;'
  },
};

