import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { CoreModule } from './core/core.module';
import { CardInsightsModule, CardTasksIndicatorModule, CarButtonViewModule, AsideNavModule, ProjectProgressBarModule } from 'projects/ngx-xchange-ui/src/public-api';

@NgModule({
  declarations: [
    AppComponent,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    CoreModule,
    CardInsightsModule,
    CarButtonViewModule,
    CardTasksIndicatorModule,
    CarButtonViewModule,
    AsideNavModule,
    ProjectProgressBarModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }

import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { NotFoundComponent } from './core/share/components/not-found/not-found.component';

const routes: Routes = [
  { path: '', loadChildren: () => "import('./public/public.module')\r\n\
  .then(m => m.PublicModule)" },
  { path: '**', component: NotFoundComponent }
];

@NgModule({
  imports: [RouterModule.forRoot(routes, {useHash: true})],
  exports: [RouterModule]
})
export class AppRoutingModule { }

import { NgModule } from "@angular/core";

@NgModule({
    imports: [],
    declarations: [],
    exports: [],
    providers: []
})

export class CoreModule{
    constructor() {}
}

import { NgModule } from "@angular/core";
import { PublicRoutingModule } from "./public-routing.module";
import { ShareModule } from "../core/share/share.module";
import { PublicComponent } from "./public.component";
import { HomeComponent } from "./home/containers/home.component";
import { LoginComponent } from "./login/containers/login.componet";
import { HeaderCardComponent } from './components/header-card/header-card.component';
import { UserNameCardComponent } from './components/user-name-card/user-name-card.component';
import { UserAvatarComponent } from './components/user-avatar/user-avatar.component';
import { CardDeadlineIndicatorModule } from "@indziaki/ngx-xchange-ui";

@NgModule({
    imports: [
        PublicRoutingModule,
        ShareModule,
        CardDeadlineIndicatorModule,
    ],
    declarations: [
        PublicComponent,
        HomeComponent,
        LoginComponent,
        HeaderCardComponent,
        UserNameCardComponent,
        UserAvatarComponent,

    ],
    exports: [],
    providers: []
})

export class PublicModule{
    constructor() {}
}

import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { PublicComponent } from './public.component';
import { HomeComponent } from './home/containers/home.component';
import { LoginComponent } from './login/containers/login.componet';

const routes: Routes = [
  {
    path: '',
    component: PublicComponent,
    children: 
    [
      { path: '', redirectTo: 'home', pathMatch: 'full' },
      { path: 'home', component: HomeComponent },
      { path: 'login', component: LoginComponent }
    ],
  },
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class PublicRoutingModule {}

import { NgModule } from "@angular/core";
import { HttpClientModule } from '@angular/common/http';
import { RouterModule } from "@angular/router";

import { NotFoundComponent } from './components/not-found/not-found.component'



@NgModule({
    imports: [
        HttpClientModule,
        RouterModule,
    ],
    declarations: [
    NotFoundComponent
  ],
    exports: [
        HttpClientModule,
        RouterModule,
        NotFoundComponent,
    ],
    providers: []
})

export class ShareModule{
    constructor() {}
}

